package com.class9;

public class FourDigits {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i=0; i<10;i++) {
			
			for (int j=0; j<10; j++) {
				
				for (int a=0; a<10; a++) {
					
					for (int s=0; s<10; s++) {
						System.out.println(a+""+j+""+a+""+s);
					}
					
				}
			}
		}

	}

}
